    render() {
        return (
            <div className="wrapper">
                <div className="title">Hello, I am Fran JurmanoviÄ‡,...</div>
                <div className="nav">You can learn more <Link to="/about">about me</Link> or jump right to my <Link to="/portfolio">portfolio</Link>.</div>
            </div>
        );
    }
}

export default Homepage;
